import home from "../icons/login.png";
import homeActive from "../icons/loggedin.png"

import React, { Component } from 'react';
import styles from "./login.css"

/**
 * Login sign in the top left corner
 */
class Login extends Component {
  constructor(props) {
    super(props);

    this.state = { connected: false };
  };

  render() { 
        return (<img className={ styles.icon } className={ styles.left }  src={this.state.connected ? home : homeActive} alt="" />);}
  }

export default Login;
